import React from 'react'
import { SliderData } from './SliderData';
import Image from '../Images/wildrift.jpg';

export default function ImageSlider() {
    return (
        <div>
            {SliderData.map((slide, index) => {
                return (
                    <div style={{backgroundImage:`url(${slide.image})`}}></div>
                )
            })}
        </div>
    )
}
